--
-- Structure de la table `repas`
--
CREATE TABLE `repas` (
  `reDate` int(8) unsigned NOT NULL,
  `rePlat` int(10) unsigned NOT NULL,
  `reUsager` int(10) unsigned NOT NULL,
  `reNbPortions` decimal(5, 3) NOT NULL,
  PRIMARY KEY (`reDate`, `rePlat`, `reUsager`),
  FOREIGN KEY(`rePlat`) REFERENCES `plat`(`plID`) ON UPDATE CASCADE ON DELETE RESTRICT,
